// 使用 Mock
var Mock = require("mockjs");
var data = Mock.mock("/login", "post", {
  status: 200,
  msg: "success",
  data: {
    token: "",
    user: {
      username: "",
      roles: "",
      // avatar:''
    },
  },
});

var data = Mock.mock("/login", "post", {
  status: 200,
  msg: "success",
  data: {
    username: "",
  },
});
// 输出结果
// console.log(JSON.stringify(data, null, 4));

export default data;
